@LoSposoMorente @GotfrydKarol Woah!!!
You got that backwards!
It is we in the West who will owe Ukraine!! Our assistance does not compare to your sacrifice and suffering. Slava Ukraini!!!!

@Maks_NAFO_FELLA I am sad. I am Ukrainian and I am greatly depressed by this event.

I hope this won't happen. I hope there will be enough decent people from America who will support Ukraine no matter what party wins the election.

But at the same time I am scared and devastated.
